        {
          "name" : "Hermansen2015 - denovo biosynthesis of pyrimidines in yeast",
          "description" : "<notes xmlns=\"http://www.sbml.org/sbml/level2/version4\">\r\n      <body xmlns=\"http://www.w3.org/1999/xhtml\">\r\n        <div class=\"dc:title\">Hermansen2015 - denovo biosynthesis of pyrimidines in yeast</div>\r\n        <div class=\"dc:bibliographicCitation\">\r\n          <p>This model is described in the article:</p>\r\n          <div class=\"bibo:title\">\r\n            <a href=\"http://identifiers.org/pubmed/26511837\" title=\"Access to this publication\">\r\nCharacterizing selective pressures on the pathway for de novo biosynthesis of pyrimidines in yeast. </a>\r\n          </div>\r\n          <div class=\"bibo:authorList\"> Hermansen RA , Mannakee BK , Knecht W , Liberles DA , Gutenkunst RN</div>\r\n          <div class=\"bibo:Journal\">BMC Evolutionary Biology. 2015, 15:232</div>\r\n          <p>Abstract:</p>\r\n          <div class=\"bibo:abstract\">\r\n            <p>\r\n    Selection on proteins is typically measured with the assumption that each protein acts independently. However, selection more likely acts at higher levels of biological organization, requiring an integrative view of protein function. Here, we built a kinetic model for de novo pyrimidine biosynthesis in the yeast Saccharomyces cerevisiae to relate pathway function to selective pressures on individual protein-encoding genes.Gene families across yeast were constructed for each member of the pathway and the ratio of nonsynonymous to synonymous nucleotide substitution rates (dN/dS) was estimated for each enzyme from S. cerevisiae and closely related species. We found a positive relationship between the influence that each enzyme has on pathway function and its selective constraint.We expect this trend to be locally present for enzymes that have pathway control, but over longer evolutionary timescales we expect that mutation-selection balance may change the enzymes that have pathway control. \r\n    </p>\r\n          </div>\r\n        </div>\r\n        <div class=\"dc:publisher\">\r\n          <p>This model is hosted on \r\n  <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\r\n  and identified by: \r\n  <a href=\"http://identifiers.org/biomodels.db/MODEL1512160000\">MODEL1512160000</a>.</p>\r\n        <p>To cite BioModels Database, please use: \r\n  <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database:\r\n  An enhanced, curated and annotated resource for published\r\n  quantitative kinetic models</a>.</p>\r\n    </div>\r\n    <div class=\"dc:license\">\r\n      <p>To the extent possible under law, all copyright and related or\r\n  neighbouring rights to this encoded model have been dedicated to\r\n  the public domain worldwide. Please refer to \r\n  <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0\r\n  Public Domain Dedication</a> for more information.</p>\r\n  </div>\r\n</body>\r\n</notes>",
          "format" : {
            "name" : "SBML",
            "version" : "L2V4"
          },
          "publication" : {
            "journal" : "BMC evolutionary biology",
            "title" : "Characterizing selective pressures on the pathway for de novo biosynthesis of pyrimidines in yeast.",
            "affiliation" : "Department of Biology and Center for Computational Genetics and Genomics, Temple University, Philadelphia, PA, 19122, USA. rhermans@uwyo.edu.",
            "synopsis" : "Selection on proteins is typically measured with the assumption that each protein acts independently. However, selection more likely acts at higher levels of biological organization, requiring an integrative view of protein function. Here, we built a kinetic model for de novo pyrimidine biosynthesis in the yeast Saccharomyces cerevisiae to relate pathway function to selective pressures on individual protein-encoding genes.Gene families across yeast were constructed for each member of the pathway and the ratio of nonsynonymous to synonymous nucleotide substitution rates (dN/dS) was estimated for each enzyme from S. cerevisiae and closely related species. We found a positive relationship between the influence that each enzyme has on pathway function and its selective constraint.We expect this trend to be locally present for enzymes that have pathway control, but over longer evolutionary timescales we expect that mutation-selection balance may change the enzymes that have pathway control.",
