        {
          "name" : "Ray2013 - Meiotic initiation in S. cerevisiae",
          "description" : "<notes xmlns=\"http://www.sbml.org/sbml/level2/version4\">\r\n      <body xmlns=\"http://www.w3.org/1999/xhtml\">\r\n        <div class=\"dc:title\">Ray2013 - Meiotic initiation in S. cerevisiae</div>\r\n        <div class=\"dc:description\">\r\n          <p>A mathematical representation of early meiotic events, particularly feedback mechanisms at the system level and phosphorylation of signalling molecules for regulating protein activities, is described here</p>\r\n        </div>\r\n        <div class=\"dc:bibliographicCitation\">\r\n          <p>This model is described in the article:</p>\r\n          <div class=\"bibo:title\">\r\n            <a href=\"http://identifiers.org/pubmed/23631506\" title=\"Access to this publication\">Dynamic modeling of yeast meiotic initiation.</a>\r\n          </div>\r\n          <div class=\"bibo:authorList\">Ray D, Su Y, Ye P.</div>\r\n          <div class=\"bibo:Journal\">BMC Syst Biol. 2013 May 1;7:37</div>\r\n          <p>Abstract:</p>\r\n          <div class=\"bibo:abstract\">\r\n            <p>\r\n              <b>BACKGROUND:</b>\r\n              Meiosis is the sexual reproduction process common to eukaryotes. The diploid yeast Saccharomyces cerevisiae undergoes meiosis in sporulation medium to form four haploid spores. Initiation of the process is tightly controlled by intricate networks of positive and negative feedback loops. Intriguingly, expression of early meiotic proteins occurs within a narrow time window. Further, sporulation efficiency is strikingly different for yeast strains with distinct mutations or genetic backgrounds. To investigate signal transduction pathways that regulate transient protein expression and sporulation efficiency, we develop a mathematical model using ordinary differential equations. The model describes early meiotic events, particularly feedback mechanisms at the system level and phosphorylation of signaling molecules for regulating protein activities.          </p>\r\n            <p>\r\n              <b>RESULTS:</b>\r\n              The mathematical model is capable of simulating the orderly and transient dynamics of meiotic proteins including Ime1, the master regulator of meiotic initiation, and Ime2, a kinase encoded by an early gene. The model is validated by quantitative sporulation phenotypes of single-gene knockouts. Thus, we can use the model to make novel predictions on the cooperation between proteins in the signaling pathway. Virtual perturbations on feedback loops suggest that both positive and negative feedback loops are required to terminate expression of early meiotic proteins. Bifurcation analyses on feedback loops indicate that multiple feedback loops are coordinated to modulate sporulation efficiency. In particular, positive auto-regulation of Ime2 produces a bistable system with a normal meiotic state and a more efficient meiotic state.          </p>\r\n            <p>\r\n              <b>CONCLUSIONS:</b>\r\n              By systematically scanning through feedback loops in the mathematical model, we demonstrate that, in yeast, the decisions to terminate protein expression and to sporulate at different efficiencies stem from feedback signals toward the master regulator Ime1 and the early meiotic protein Ime2. We argue that the architecture of meiotic initiation pathway generates a robust mechanism that assures a rapid and complete transition into meiosis. This type of systems-level regulation is a commonly used mechanism controlling developmental programs in yeast and other organisms. Our mathematical model uncovers key regulations that can be manipulated to enhance sporulation efficiency, an important first step in the development of new strategies for producing gametes with high quality and quantity.          </p>\r\n          </div>\r\n        </div>\r\n        <div class=\"dc:publisher\">\r\n          <p>This model is hosted on        <a href=\"http://www.ebi.ac.uk/biomodels/\">BioModels Database</a>\r\n            and identified\r\nby:        <a href=\"http://identifiers.org/biomodels.db/BIOMD0000000626\">BIOMD0000000626</a>\r\n            .        </p>\r\n        <p>To cite BioModels Database, please use:        <a href=\"http://identifiers.org/pubmed/20587024\" title=\"Latest BioModels Database publication\">BioModels Database: An enhanced, curated and annotated resource\r\nfor published quantitative kinetic models</a>\r\n            .        </p>\r\n    </div>\r\n    <div class=\"dc:license\">\r\n      <p>To the extent possible under law, all copyright and related or\r\nneighbouring rights to this encoded model have been dedicated to the public\r\ndomain worldwide. Please refer to        <a href=\"http://creativecommons.org/publicdomain/zero/1.0/\" title=\"Access to: CC0 1.0 Universal (CC0 1.0), Public Domain Dedication\">CC0 Public Domain\r\nDedication</a>\r\n            for more information.        </p>\r\n  </div>\r\n</body>\r\n</notes>",
          "format" : {
            "name" : "SBML",
            "version" : "L2V4"
          },
          "publication" : {
            "journal" : "BMC systems biology",
            "title" : "Dynamic modeling of yeast meiotic initiation.",
