    body:
      encoding: UTF-8
      string: |-
        {
          "name" : "Bier2000_GlycolyticOscillation",
          "description" : "<notes xmlns=\"http://www.sbml.org/sbml/level2/version4\">\r\n      <body xmlns=\"http://www.w3.org/1999/xhtml\">\r\n        <p>This a model from the article:\r\n      <br />\r\n        <strong>How yeast cells synchronize their glycolytic oscillations: a perturbation analytic treatment \r\n</strong>\r\n        <br />\r\nBier M, Bakker BM, Westerhoff HV.\r\n      <em>Biophys. J</em>2000 Mar;78(3):1087-93.\r\n      <a href=\"http://www.ncbi.nlm.nih.gov/pubmed/10692299\">10692299</a>,\r\n      <br />\r\n        <strong>Abstract:</strong>\r\n        <br />\r\nOf all the lifeforms that obtain their energy from glycolysis, yeast cells are among the most basic. Under certain conditions the concentrations of the glycolytic intermediates in yeast cells can oscillate. Individual yeast cells in a suspension can synchronize their oscillations to get in phase with each other. Although the glycolytic oscillations originate in the upper part of the glycolytic chain, the signaling agent in this synchronization appears to be acetaldehyde, a membrane-permeating metabolite at the bottom of the anaerobic part of the glycolytic chain. Here we address the issue of how a metabolite remote from the pacemaking origin of the oscillation may nevertheless control the synchronization. We present a quantitative model for glycolytic oscillations and their synchronization in terms of chemical kinetics. We show that, in essence, the common acetaldehyde concentration can be modeled as a small perturbation on the \"pacemaker\" whose effect on the period of the oscillations of cells in the same suspension is indeed such that a synchronization develops.\r\n</p>\r\n      </body>\r\n    </notes>",
          "format" : {
            "name" : "SBML",
            "version" : "L2V4"
          },
          "publication" : {
            "journal" : "Biophysical journal",
            "title" : "How yeast cells synchronize their glycolytic oscillations: a perturbation analytic treatment.",
            "affiliation" : "Section of Plastic and Reconstructive Surgery, Dept. of Surgery MC 6035, University of Chicago, Chicago, Illinois 60637, USA. mbier@surgery.bsd.uchicago.edu",
            "synopsis" : "Of all the lifeforms that obtain their energy from glycolysis, yeast cells are among the most basic. Under certain conditions the concentrations of the glycolytic intermediates in yeast cells can oscillate. Individual yeast cells in a suspension can synchronize their oscillations to get in phase with each other. Although the glycolytic oscillations originate in the upper part of the glycolytic chain, the signaling agent in this synchronization appears to be acetaldehyde, a membrane-permeating metabolite at the bottom of the anaerobic part of the glycolytic chain. Here we address the issue of how a metabolite remote from the pacemaking origin of the oscillation may nevertheless control the synchronization. We present a quantitative model for glycolytic oscillations and their synchronization in terms of chemical kinetics. We show that, in essence, the common acetaldehyde concentration can be modeled as a small perturbation on the \"pacemaker\" whose effect on the period of the oscillations of cells in the same suspension is indeed such that a synchronization develops.",
